const heading = {
  color : "#Fa9191",
  textAlign : "center",
  textTransform : "capitalize",
  fontWeight : "bold",
  textShadow: "0px 2px 4px #ffe9c5",
  margin: "50px 0"
};


ReactDOM.render(
  <>
  <h1 style={heading}> my name is {name}</h1>
<div className="img_div">
  <img src= {img1} />
  <img src= {img2} />
  <img src= {img3} />
  <a href="https://kryosssoftech.com/">
  <img src= {img4} />
  </a>
  </div>
</>,
  document.getElementById("root")
);
